Thunder Turret: DC 15 to find, DC 10 to disable;
    initiative +2, 1 attack per round, affects all targets within a 20 ft. cone, DC 14 save or take 10d10 thunder damage
    and become deafened for 1d4 rounds

Altar of Chaos: DC 10 to find, DC 15 to disable;
    affects lawful creatures within 20 ft., DC 18 save or take 18d10 damage
    and become confused for 1d4 rounds

Acid Turret: DC 20 to find, DC 10 to disable;
    initiative +4, 1 attack per round, affects all targets within a 20 ft. cone, DC 13 save or take 4d10 acid damage
    for 1d4 rounds

Animated Net Trap: DC 10 to find, DC 15 to disable;
    affects all targets within a 10 ft. square area, DC 11 save or become restrained
    and take 4d10 damage per round
